    'Memo text' field of original report, the data file was damaged and failed to
    upload on October 15th, the due date for October 15 Quarterly Report (Q3).  An
    earlier backup copy of Q3 was uploaded to meet deadline; the filed backup copy
    had incomplete data.  With the help of FEC Technical Support (special thanks to
    Ms. Eliza Green), the original and complete report was fixed within an hour after
    being emailed to FEC.  This amendment has the fixed and complete data for Q3 report.
    \  ==================================================================** In response
    to FEC letter dated December 20th 2013: Dear Ryan, please note that the contributions
    indicated in your letter have been corrected and the designated elections and
    reports have been amended. The mistakenly PAC donations were corrected on QTR2
    and on this report and recorded as individual contributions (entity not qualified
    as PAC). Both contributions indicated in your letter have been refunded to donors.\n"
